import { useState } from "react"


export const Usuario = ({nombre, largo}) =>{
    const [visibilidad,setVisibilidad] = useState(true);
    function cambiar(){
        setVisibilidad(!visibilidad);
    }

    return <div>
        <h1>Inicio de sesion</h1>
        <form>
            <div>
                Usuario:<input typer="text"/>
            </div>
                Clave:<input typer="text"/>

        </form>
        <p>Usuario:</p>
        <p>Clave: </p>
        <button onClick={cambiar}>{visibilidad ? "Presiona":"nop"}</button>
        <hr/>


    </div>
}
